    public static (int totalDistance, int totalDepth) CalculateDepth(string commands)
    {
        int depthPerMeter = 0;
        int totalDistance = 0;
        int totalDepth = 0;

        foreach (var command in commands.Split(','))
        {
            var parts = command.Split(' ');
            var direction = parts[0];
            var value = int.Parse(parts[1]);

            value *= direction == "Up" ? 1 : -1;

            if (direction == "Forward")
            {
                totalDistance += value;
                totalDepth += depthPerMeter * value;
            }
            else
            {
                depthPerMeter += value;
            }
        }

        return (totalDistance, totalDepth);
    }
